import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="section contact">
      <h1>Contact Me</h1>
      <p>Email: <a href="mailto:hello@bhaveshc.com">hello@bhaveshc.com</a></p>
    </section>
  );
}

export default Contact;
